===Statistics===
* According to the 2010 United States Census, ''Yadao'' is the 24554<sup>th</sup> most common surname in the United States, belonging to 1018 individuals. ''Yadao'' is most common among Asian/Pacific Islander (70.83%), Multi-racial (12.87%), and Hispanic/Latino (10.51%) individuals.
